    <Paper
      sx={{
        backgroundColor: "Red", //#1b1b1b
        minWidth: "360px",
        paddingBottom: "10px",
        paddingTop: "60px",
      }}
    >
      <Post />
    </Paper>
  );
}

export default HashTag;
